export interface Pet {
    name:string,
    breed:string,
    image:string,
    isAdopted:boolean
}

let dogArray:Pet[] = [
    {name: "Bones", breed: "Corgi", image: "One", isAdopted: false},
    {name: "Bones", breed: "Corgi", image: "Two", isAdopted: true},
    {name: "Bones", breed: "Corgi", image: "Three", isAdopted:false},
    {name: "Bones", breed: "Corgi", image: "Four", isAdopted: true}
];

let catArray:Pet[] = [
    {name: "Major", breed: "Bombay Cat", image: "One", isAdopted: false},
    {name: "Bones", breed: "Corgi", image: "Two", isAdopted: true},
    {name: "Bones", breed: "Corgi", image: "Three", isAdopted: false},
    {name: "Bones", breed: "Corgi", image: "Four", isAdopted: true}
];

